import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on the cart element
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { state: 'visible', timeout: 5000 });

    // Take screenshot of opened cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal.png'));

    // Extract cart information
    const cartCount = await page.textContent('.cart');
    const cartItems = await page.$$eval('.cart-item', items => items.length);
    const cartTotal = await page.textContent('#cartTotal');

    return {
      success: true,
      action: "Successfully opened shopping cart modal",
      extractedData: {
        cartCount: cartCount.trim(),
        itemsInCart: cartItems,
        cartTotal: cartTotal
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open shopping cart modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
